import React from 'react';

const Task = (value) => {
  return (
    <li>{value}</li>
  );
}

function App() {
  return (
    <div className="App">
      <h1>Lista de coisas a fazer:</h1>
      <ol>{ Task('Programar') }{ Task('Aprender React') } </ol>
    </div>
  );
}

export default App;
